								<div itemprop="articleBody">
		<p><br />VUSL’s Interliga first exhibition match will be tonight Saturday, February 7, 2015 against CD Aguiluchos USA. Our select team for tonight’s match is composed of players that play in local soccer leagues from cities such as Fresno, Mendota, and Porterville. We will be competing against a team from the National Premier Soccer League (NPSL), which competes in the Golden Gates Conference category for the West Region.</p>
<p>Although we had to cut down our list to twenty two players, there were a great number of extraordinary soccer players that we had to leave out for this match. There were also, other local players that were not able to come out to tryouts; however, we have trust in our twenty two soccer players to represent us well tonight.</p>
<p>Goodluck tonight VUSL, and remember we’re the Home Team tonight.<br /><br /><img class="borderclass" src="images/site/blog2.jpg" alt="" /></p> 	</div>

	
